import React from 'react';
import { Button } from '../../Components/Buttons';
import { Card } from '../../Components/Cards';
import { Container } from '../../Components/Grid';

const Main = () => {
	const theme = useTheme();
	console.log(theme);

	return (
		<React.Fragment>
			<Container>
				<Card>
					<Button />
				</Card>
			</Container>
		</React.Fragment>
	);
};

export default Main;
